import React from 'react';
import Books from './Books';
import Authors from './Authors';

const Data = () => {
  return (
    <div>
      <h1>Data</h1>
      <h2>Books</h2>
      <Books />
      <h2>Authors</h2>
      <Authors />
    </div>
  );
};

export default Data;
